measurements.description:
Twelve flowers on one 72-cm staked inflorescence;
 sepals and petals yellow, blushed burgundy, veins burgundy, heavier burgundy medially;

lip cream, side lobes blotched dark burgundy, keels cream-yellow marked burgundy, midlobe center burgundy stripe, heavily blotched 
burgundy distally, picotee; column pale yellow, blotched burgundy; substance firm; texture matte.
